import React from 'react';

function MediaCard(props) {
    return (
        <div className={ classes.root }>
            <h4>
                Lizard
            </h4>
            <p>
                Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging
                across all continents except Antarctica
            </p>
        </div>
    );
};

function Link(props) {
    return (
        <a href={ props.link }>
            { props.title }
        </a>
    )
}
export default Link;
